import React from 'react';
import Clock from 'react-digital-clock';

const App = () => {
  return (
    <>
      <div style={{ backgroundColor: 'blue' }}>
        <h1>Digital Clock By npm</h1>
        <Clock />
      </div>
    </>
  );
};

export default App;
